import React from 'react'
import { ImageBackground, StyleSheet, Text, TouchableOpacity, View, Image } from 'react-native'
import bg from '../image/bg1.png'
import plus from '../image/plus.png'


export default function Answer({navigation}) {
    return (
        <View style={styles.game}>
        <ImageBackground source={bg} style={styles.gamePhoto}>
        <View style={styles.textLevel}>
            <Text style={styles.level}>Easy level</Text>
                   <Image style={styles.plus} source={plus}/>
        </View>
          <View>
              <Text style={styles.second}>seconds left</Text>
          </View>      
                   <View  style={styles.randomNumber}>
                   </View>
            <TouchableOpacity style={styles.next} 
            onPress={()=>
                navigation.navigate('Correct')
            }>  
            <Text style={styles.nextText}>CHECK</Text>
            </TouchableOpacity>  
            </ImageBackground>
        </View>   
    )
}
const styles = StyleSheet.create({
    game: {
        flex: 1,
    },
    gamePhoto: {
        height: '100%',
        width: '100%'
    },
    textLevel: {
        width: '80%',
        flex: 1,
        flexDirection: 'row',
        justifyContent: 'space-around', 
        marginTop: '15%',
        marginLeft: '10%'  
    },
    plus: {
        width: 45,
        height: 45,

    },
    level: {
       color: '#0186BF',
       fontSize: 35,  
    },
    second: {
        color: '#0186BF',
        textAlign: 'center',
        fontSize: 27,
        marginBottom: '5%'
        // marginTop: 80,
     },
     randomNumber: {
        width: 150,
        height: 150,
        backgroundColor: 'rgba(175,212,113,0.2)',
        borderWidth: 1,
        borderColor: 'rgba(175,212,113,1)',
        borderRadius: 25,
        marginBottom: '5%',
        marginLeft: '30%',
    },
      next: {
        marginLeft: '10%',
        width: 300,
        height: 40, 
       borderRadius: 50,
       backgroundColor: '#AFD471',
       marginBottom: '60%'

    },
    nextText: {
        color: 'white',
        textAlign: 'center',
        fontSize: 25,
     },

})
